{% extends "hunt_base.html" %}
{% block title %}Puzzles!{% endblock title %}

{% block base_includes %}
<link rel="stylesheet" type="text/css" href="{{ STATIC_URL }}huntserver/hunt_base.css">
<style>
html {
	min-height: 100%;
}

body {
	min-height: 100%
	background: #000;
	background: -webkit-radial-gradient(circle, #392406, black); /* Safari */
  background: -o-radial-gradient(circle, #392406, black); /* Opera 11.6 to 12.0 */
  background: -moz-radial-gradient(circle, #392406, black); /* Firefox 3.6 to 15 */
  background: radial-gradient(circle, #392406, black); /* Standard syntax */
}

#container {
	color: #FFA31C;
	font-family: 'PT Mono', monospace;
	
	width: 100%;
	height: 100%;
}

.puzzdiv {
	border-style:solid;
	border-color:#FFA31C;
	background: #000;
	padding: 20px;
	z-index: 10;
	width: 90%;
	
	margin-left: auto;
	margin-right: auto;
}

@media (min-width: 768px) {
	.puzzdiv {
		width: 700px;
	}
}

@media (min-width: 992px) {
	.puzzdiv {
		width: 450px;
	}
}

@media (min-width: 1200px) {
	.puzzdiv {
		width: 600px;
	}
}

@media (max-width: 768px) {
	#terminal {
		display: none;
	}
}

.puzzdiv h1 {
	margin-top:0px;
	font-size: 25px;
	text-align: center;
	font-weight: bold;
}

.puzzdiv hr {
	border:none;
  border-top:1px dashed #FFA31C;
  color:#000;
  background-color:#000;
  height:1px;
}

tbody:before {
	content: "-";
	display: block;
	line-height: 0.3em;
	color: transparent;
}

th {
	text-align: left;
	font-weight: bold;
	font-size: 1.2em;
}

h3 {
	text-align: left;
	font-weight: bold;
	font-size: 1.2em;
	margin-bottom: 0px;
}

a {
	color: #FFA31C;
}

a:hover {
	color: #FFA31C;
}

#aperturelogo {
	position: absolute;
	left: -40px;
	top: 90px;
	z-index: -7;
}

#scanlines {
	background-image: url("/media/hunt/assets/scanline.png");
  background-repeat: repeat-xy;
	
	position: absolute;
	height: 100%;
	min-height: 160.38988mm;
	width: 100%;
	left: 0;
	right: 0;
	top: 90px;
	bottom: 0;
	z-index: -5;
}

#terminal {
	color: #8D5400;
	
	position: absolute;
	width: 300px;
	right: 40px;
	top: 140px;
	z-index: -10;
}

#footer {
	display: none;
}

#logodiv {
	position: absolute;
	right: 0px;
	left: 0px;
	bottom: 0px;
	text-align: center;
	line-height: 100px;
	overflow: hidden;
	height: 100px;
}
#disclaimerdiv {
	position: absolute;
	right: 0px;
	left: 0px;
	top: 100%;
	text-align: center;
	overflow: hidden;
	color: #fff;
	font-size: 0.8em;
}

.logoimg	{
	height: 40px;
}

#wrapper {
	position: relative;
	padding-top: 100px;
	padding-bottom: 100px;
	min-height: 180mm;
}

.divider {
	border-left:2px #fff solid; 
	height: 40px;
	display: inline;
	margin-left: 10px;
	margin-right: 10px;
}

</style>
{% endblock base_includes %}

