			id="path3735" />
	</svg>
	<div id="scanlines"></div>
	
	<div id="wrapper">
		<div class="puzzdiv">
			<h1>APERTURE SCIENCE STUDENT TESTING INITIATIVE</h1>
			<hr />
			{% for puzzle in puzzles %}
				{% if puzzle.puzzle_number == 1 %}
					<div style="text-align:center; maring-bottom:0.5em">
						<a href="https://youtu.be/tEY7hzkjPTs">Intro Video</a>
					</div>
				{% endif %}
