						</tr>
					</thead>
					<tbody>
						{% for puzzle in puzzles %}
						
							{% if puzzle.puzzle_number == 9 %}
									</tbody>
								</table>
								<h3>Meta 1</h3>
								<table>
									<tbody>
									<col width="320px">
									<col width="180px">
							{% endif %}
							
							{% if puzzle.puzzle_number == 11 %}
									</tbody>
								</table>
								<h3>Round 2</h3>
								<table>
									<tbody>
									<col width="320px">
									<col width="180px">
							{% endif %}
                            
                            {% if puzzle.puzzle_number == 10 %}
									</tbody>
								</table>
								<h3>Interactive</h3>
								<table>
									<tbody>
									<col width="320px">
									<col width="180px">
							{% endif %}
							
							{% if puzzle.puzzle_number == 19 %}
									</tbody>
								</table>
								<h3>Meta 2</h3>
								<table>
									<tbody>
									<col width="320px">
									<col width="180px">
							{% endif %}
						
                            {% if puzzle.puzzle_number != 50 %}
                                <tr>
                                    <td><a href="/puzzle/{{ puzzle.puzzle_id }}/">{{puzzle.puzzle_name}}</a></td>
                                    <td>{% if puzzle in solved %}{{ puzzle.answer|upper }}{% endif %}</td>
                                </tr>
                            {% endif %}
                            
						{% endfor %}
                        {% for puzzle in puzzles %}
                            {% if puzzle.puzzle_number == 50 %}
                                </tbody>
								</table>
								<h3>Run around</h3>
								<table>
									<tbody>
									<col width="320px">
									<col width="180px">
                                <tr>
                                    <td><a href="/puzzle/{{ puzzle.puzzle_id }}/">{{puzzle.puzzle_name}}</a></td>
                                    <td>{% if puzzle in solved %}{{ puzzle.answer|upper }}{% endif %}</td>
                                </tr>
                            {% endif %}
                        {% endfor %}
					</tbody>
				</table>
			</div>
			<div id="logodiv">
				<img src="/media/hunt/assets/logoaperture.png" class="logoimg"></img>
				<img class="divider"></img>
				<img src="/media/hunt/assets/logojanestreet.png" class="logoimg"></img>
				<img class="divider"></img>
				<img src="/media/hunt/assets/logopuzzlehunt_bw.png" class="logoimg"></img>
			</div>
			<div id="disclaimerdiv">
				PuzzlehuntCMU is not affiliated with Valve Corporation in any way.  
				This is an entirely fan-made hunt.
			</div>
		</div>
	</div>
</div>
{% endblock content %}

