                                            href="/protected/puzzles/909-basic-image-editor.html"
                                            {% else %}
                                            href="/puzzle/{{ puzzle.puzzle_id }}/"
                                            {% endif %}
                                            >{{puzzle.puzzle_name}}</a></div>
                                        <div class="puzzUnderline"></div>
                                    </td>
                                    <td class="answerCell">
                                      {% if puzzle.puzzle_number == 1 %}
                                            <div class="answerNumber">8</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 2 %}
                                            <div class="answerNumber">1</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 3 %}
                                            <div class="answerNumber">3</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 4 %}
                                            <div class="answerNumber">4</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 5 %}
                                            <div class="answerNumber">6</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 6 %}
                                            <div class="answerNumber">7</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 7 %}
                                            <div class="answerNumber">5</div>
                                            {% endif %}
                                            
                                            {% if puzzle.puzzle_number == 8 %}
                                            <div class="answerNumber">2</div>
                                            {% endif %}
                                        <div class="answerUnderline"></div>
                                    </td>
                                </tr>
                                {% endif %}

                            
                            {% else %}
                                {% if puzzle in solved %}
                                <tr class="redSolvedRow">
                                    <td class="firstCol puzzCell">
                                        <div class="unlockSegment"></div>
                                        <div class="puzzTitle"><a href="/puzzle/{{ puzzle.puzzle_id }}/">{{puzzle.puzzle_name}}</a></div>
                                        <div class="puzzUnderline"></div>
                                    </td>
                                    <td class="answerCell">
                                        <div class="puzzleAnswer">{{ puzzle.answer|upper }}</div>
                                        <div class="answerUnderline"></div>
                                    </td>
                                </tr>
                                {% else %}
                                <tr class="redUnlockedRow">
                                    <td class="firstCol puzzCell">
                                        <div class="unlockSegment"></div>
                                        <div class="puzzTitle"><a href="/puzzle/{{ puzzle.puzzle_id }}/">{{puzzle.puzzle_name}}</a></div>
                                        <div class="puzzUnderline"></div>
                                    </td>
                                    <td class="answerCell">
                                        <div class="answerUnderline"></div>
                                    </td>
                                </tr>
                                {% endif %}
                            {% endif %}

                            {% if puzzle.puzzle_number == 18 %}
                            <tr class="accessLevelRow redUnlockedRow">
                                <td class="firstCol accessLevelCell">
                                    <div class="unlockNumber"></div>
                                    <div class="videoLinkImg">
                                        <div class="videoTitle"><a href="https://youtu.be/1AflsCH1s60" target="_blank">Success.mp4</a></div>
                                    </div>
                                </td>
                                <td></td>
                            </tr>
                            {% endif %}

                        {% endfor %}
					</tbody>
				</table>
			</div>
			<div id="logodiv">
				<img src="/static/huntserver/f18template/images/JaneStreet.png" class="logoimg"></img>
			</div>
		</div>
	</div>
</div>
